import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { getCurrentProfile } from '../../actions/profile';

const dashboard = props => {
  return <div>Dashboard</div>;
};

dashboard.propTypes = {};

export default connect(
  mapStateToProps,
  { getCurrentProfile }
)(dashboard);
